import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { InicioComponent } from './pages/inicio/inicio.component';
import { RecetasComponent } from './pages/leer/leer.component';
import { NosotrosComponent } from './pages/nosotros/nosotros.component';
import { CrearComponent } from './pages/crear/crear.component';
import { ViewRecetaComponent } from './pages/view-receta/view-receta.component';

const routes: Routes = [
  {path:"paginas/inicio", component: InicioComponent},
  {path:"paginas/nosotros", component: NosotrosComponent},
  {path:"paginas/leer", component: RecetasComponent},
  {path:"paginas/crear/:nombre", component: ViewRecetaComponent},
  {path:"paginas/crear", component: CrearComponent}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
